import React from 'react'
import { Route } from 'react-router-dom'
import { Button } from 'reactstrap'
import { Login, Home } from './pages'

function App() {
  return (
    <div>
      <Route path="/" component={Home} exact />
      <Route path="/Login" component={Login} exact />
    </div>
  );
}

export default App;
